import { userEffect } from "react";

const Import = ({ IMP }) => {
  return (
    <>
      <h1>test</h1>
    </>
  );
};

export const getServerSideProps = (context) => {
  context.store.dispatch();
  IMP.init("imp37098043");
  return { props: { IMP } };
};

export default Import;
